}

void loop() {

    for (int digito = 0; digito < 10; digito++) {

      if (digito != 1 && digito != 4)
        digitalWrite(a, LOW);

      if (digito != 5 && digito != 6)
        digitalWrite(b, LOW);

      if (digito != 2)
        digitalWrite(c, LOW);

