        digitalWrite(d, LOW);

      if (digito == 2 || digito == 6 || digito == 8 || digito == 0)
        digitalWrite(e, LOW);

      if (digito != 1 && digito != 2 && digito != 3 && digito != 7)
        digitalWrite(f, LOW);

      if (digito != 0 && digito != 1 && digito != 7)
        digitalWrite(g, LOW);

      digitalWrite(ponto, !digitalRead(ponto));

      delay(1000);

      digitalWrite(a, HIGH);
      digitalWrite(b, HIGH);
      digitalWrite(c, HIGH);
      digitalWrite(d, HIGH);
      digitalWrite(e, HIGH);
      digitalWrite(f, HIGH);
      digitalWrite(g, HIGH);

    }

}

#include <iostream>
#include <string>
#include <algorithm>
#include <cstdlib>

class Player {
    
private:
    std::string _name;
    int _score;

public:
    //–≥–µ—Ç—Ç–µ—Ä—ã
    std::string Name() const { return _name; }
    int Score() const { return _score; }
    
    //—Å–µ—Ç—Ç–µ—Ä—ã
    void SetName(const std::string& name) {_name = name; }
    void SetScore(int score) { _score = score; }
    
    //–ö–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä—ã
    Player(const std::string& name, int score) : _name(name), _score(score) {}
    Player()
    {
         _score = rand() % 100;
         _name = "Player" + std::to_string(_score);
    }
    
};

bool ComparePlayers(const Player* a, const Player* b) {
    return a->Score() > b->Score(); 
}

int main()
{
    const int numPlayers = 10;
    Player* players[numPlayers];

    for (int i = 0; i < numPlayers; ++i) {
        players[i] = new Player();
    }

    std::sort(players, players + numPlayers, ComparePlayers);

    for (int i = 0; i < numPlayers; ++i) {
        std::cout << players[i]->Name() << ": " << players[i]->Score() << std::endl;
    }

    for (int i = 0; i < numPlayers; ++i) {
        delete players[i];
    }

    return 0;
}

