from pyln.client import Plugin
import json

plugin = Plugin()

@plugin.init()
def init(options, plugin, configuration, **kwargs):
    plugin.log("Plugin fundscollector loaded!")

# Notes
# "fundscollector" in <@plugin.method("fundscollector")> defines the plugin name
# when we want to run it already inside CLN

# "out_opt" in <out_opt = plugin.get_option("out_opt")> and in
# <plugin.add_option('out_opt', 'test_default', 'Type of funds to show')>
# defines one option to pass to the plugin when LOADING the plugin


@plugin.method("fundscollector")
def fundscollector_function(plugin, fundstype = "offchain"):
    onchain_funds = 0
    offchain_funds = 0
    misc_funds = 0
    json_outputs = plugin.rpc.listfunds().get("outputs")
    if json_outputs:
        num_of_objects = len(json_outputs)
        print(f"There are {num_of_objects} objects in the 'outputs' list!")
        for idx, outputs_obj in enumerate(json_outputs):
            print(f"\nObject {idx + 1}:")
            for key, value in outputs_obj.items():
                print(f" - {key}: {value}")
                if key == "amount_msat":
                    onchain_funds += value
        print(f"Total amount onchain: {onchain_funds}!")
    else:
        print(f"Onchain wallet is empty or wallet does not exist")
    json_channels = plugin.rpc.listfunds().get("channels")
    if json_channels:
        num_of_objects = len(json_channels)
        print(f"There are {num_of_objects} objects in the 'channels' list!")
        for idx, channels_obj in enumerate(json_channels):
            print(f"\nObject {idx + 1}:")
            for key, value in channels_obj.items():
                print(f" - {key}: {value}")
                if key == "our_amount_msat":
                    offchain_funds += value
                    print(f"Total amount offchain: {offchain_funds}!")
    else:
        print("Apparently there are no channels open!")
    misc_funds = onchain_funds + offchain_funds
    if fundstype == "onchain":
        return {
            "Total amount of onchain funds": onchain_funds,
        }
    if fundstype == "offchain":
        return {
            "Total amount of offchain funds": offchain_funds,
        }
    if fundstype == "misc":
        return {
            "Total amount of misc funds": misc_funds,
        }
    if fundstype == "all":
        return {
            "Total amount of onchain funds": onchain_funds,
            "Total amount of offchain funds": offchain_funds,
            "Total amount of misc funds": misc_funds,
        }

plugin.run()

